  public getOrdem(): Observable<OrdemServico[]>{
    return this.http.get<OrdemServico[]>(this.baseURL);
  }



  public getOrdemById(): Observable<OrdemServico[]>{
    return this.http.get<OrdemServico[]>(this.baseURL);
  }



  getUserOrdem(usuario: string): Observable<OrdemServico[]>  {
    return this.http.get<OrdemServico[]>(`${this.baseURL}/$usuario/{idUsuario}`);
